INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (4, 0, "", 1, 1, 1110501, 11, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 111011, 0, 1110501043);
